:link :visited :hover :active :nth-child Styling links is not exactly as straight forward as styling a regular element, and that's because links have states. And these states can be expressed using our pseudo-classes. An example: header li { list-style: none
}
// visited means that HTML allows that after you click a particular link that a different style can be applied to that link than an unclicked link
// In our case, however, we don't want to differentiate between the two, so we'll style them both together.
a:link, a:visited { // <a> tag defines a hyperlink, which is used to link from one page to another. text-decoration: none; background-color: green; border: 1px solid blue; display: block; // <a> tag is an inline element. Here we change it to a block-level element. width: 200px; text-align: center; margin-bottom: 1px;
}
// An active is that state when the user actually clicks on the element but hasn't yet released his click. a:hover, a:active { background-color: red; color: purple;
}
// the nth child pseudo-selector allows you to target a particular element within a list.
header li:nth-child(3) { font-size: 24px;
}
// Set every odd member has a gray backgroud.
section div:nth-child(odd) { background-color: gray
}
// When the cursor hovers on the 4th member, the 4th member change the color to green.
section div:nth-child(4):hover { background-color: green; cursor: pointer;
}

