Static positioning Normal document flow. Default for all, except html. Relative Positioning Element is positioned relative to its position in normal document flow. Positioning CSS(offset) properties are: top, bottom, left, right. Html positioning is defaulted by relative Absolute Positioning All offsets(top, bottom, left, right) are relative to the position of the nearst ancestor which has positioning set on it, other than static. <!DOCTYPE html>
<html>
<head>
<meta charset="utf-8">
<title>Positioning Elements</title>
<style>
* { box-sizing: border-box; margin: 0; padding: 0;
}
h1 { margin-bottom: 15px;
} div#container { background-color: #00FFFF; position: relative; top: 60px; // equivalent to 'from top'
}
p { width: 50px; height: 50px; border: 1px solid black; margin-bottom: 15px;
}
#p1 { background-color: #A52A2A; position: relative; top: 65px; left: 65px;
}
#p2 { background-color: #DEB887;
}
#p3 { background-color: #5F9EA0; position: absolute; // the absolute positioning needs a relative or an absolute parent or an ancestor. top: 0; left: 0;
}
#p4 { background-color: #FF7F50;
} </style>
</head>
